import React from 'react';
import { Link } from 'react-router-dom';
function Navbar() {
  return (
    <ul>
      <Link to="/login">Login</Link>
      <Link to="/register">Register</Link>
      <Link to="/posts">Posts</Link>
    </ul>
  );
}

export default Navbar;
